import "./ContactMainPage.css";

const Contactmainpagesection = () => {
    return (
        <div className="Contactmainpagesection">
            <h3 className="Contactmainpagesection__title">Contact</h3>
            <form action="" className="contactform">
                <label htmlFor="" className="contactform__label"></label>
                <input type="text" placeholder="Naam" id=""  className=""/>
                <label htmlFor="" className="contactform__label">Email:</label>
                <input type="text" placeholder="Email" id=""  className=""/>
                <label htmlFor="" className="contactform__label">Subject:</label>
                <input type="text" placeholder="Subject" id=""  className=""/>
            </form>
            <button>Verzenden</button>
        </div>
    )
}

export default Contactmainpagesection;
